import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { fetchAWSStatus } from '../features/awsServices/awsServicesSlice';
import { 
    Grid, 
    Card, 
    CardContent, 
    Typography, 
    CircularProgress,
    Alert,
    Box,
    Paper,
    Container,
    Divider,
    useTheme,
    LinearProgress,
    TextField,
    Select,
    MenuItem,
    InputLabel,
    FormControl,
    Chip
} from '@mui/material';
import WebsiteMonitoring from './WebsiteMonitoring';
import LogManagement from './LogManagement';
import CloudIcon from '@mui/icons-material/Cloud';
import StorageIcon from '@mui/icons-material/Storage';
import FunctionsIcon from '@mui/icons-material/Functions';
import DnsIcon from '@mui/icons-material/Dns';
import HubIcon from '@mui/icons-material/Hub';
import AlertsManager from './AlertsManager';
import ResourceActions from './ResourceActions';
import { styled } from '@mui/material/styles';
import DashboardIcon from '@mui/icons-material/Dashboard';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';
import APMDashboard from './APMDashboard';
import RUMDashboard from './RUMDashboard';
import DatabaseMetrics from './DatabaseMetrics';
import DiskSpaceMetrics from './DiskSpaceMetrics';
import { alpha } from '@mui/material/styles';
import SpeedIcon from '@mui/icons-material/Speed';
import MemoryIcon from '@mui/icons-material/Memory';
import NetworkCheckIcon from '@mui/icons-material/NetworkCheck';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const StyledCard = styled(Card)(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  position: 'relative',
  '&:hover': {
    transform: 'translateY(-4px)',
    transition: 'transform 0.3s ease'
  }
}));

const MetricValue = styled(Typography)(({ theme }) => ({
  fontSize: '2rem',
  fontWeight: 'bold',
  color: theme.palette.primary.main
}));

const ServiceCard = ({ title, icon, data, children }) => {
    const theme = useTheme();

    return (
        <Card 
            elevation={2}
            sx={{
                height: '100%',
                transition: 'transform 0.2s, box-shadow 0.2s',
                '&:hover': {
                    transform: 'translateY(-4px)',
                    boxShadow: theme.shadows[4],
                }
            }}
        >
            <CardContent>
                <Box display="flex" alignItems="center" mb={2}>
                    {icon}
                    <Typography variant="h6" ml={1}>
                        {title}
                    </Typography>
                </Box>
                <Divider sx={{ mb: 2 }} />
                {children}
            </CardContent>
        </Card>
    );
};

// Enhanced styled components
const DashboardCard = styled(Card)(({ theme }) => ({
    background: `linear-gradient(135deg, ${alpha(theme.palette.primary.main, 0.05)} 0%, ${alpha(theme.palette.primary.main, 0.1)} 100%)`,
    backdropFilter: 'blur(10px)',
    borderRadius: theme.spacing(2),
    transition: 'all 0.3s ease-in-out',
    '&:hover': {
        transform: 'translateY(-8px)',
        boxShadow: theme.shadows[8],
    }
}));

const MetricBox = styled(Box)(({ theme }) => ({
    padding: theme.spacing(2),
    borderRadius: theme.spacing(2),
    background: alpha(theme.palette.background.paper, 0.8),
    backdropFilter: 'blur(8px)',
    display: 'flex',
    alignItems: 'center',
    gap: theme.spacing(2)
}));

const Dashboard = () => {
    const dispatch = useDispatch();
    const { data, status, error } = useSelector((state) => state.awsServices);
    const theme = useTheme();

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [statusResponse, dbMetricsResponse, diskMetricsResponse] = await Promise.all([
                    fetch('http://localhost:5001/api/status'),
                    fetch('http://localhost:5001/api/db-metrics'),
                    fetch('http://localhost:5001/api/disk-metrics')
                ]);

                const statusData = await statusResponse.json();
                const dbMetricsData = await dbMetricsResponse.json();
                const diskMetricsData = await diskMetricsResponse.json();

                dispatch(fetchAWSStatus());
                // Update your Redux store with the new metrics
                dispatch(updateData({
                    ...statusData,
                    dbMetrics: dbMetricsData,
                    diskMetrics: diskMetricsData
                }));
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
        const interval = setInterval(fetchData, 30000);
        return () => clearInterval(interval);
    }, [dispatch]);

    useEffect(() => {
        console.log('Current data:', data);
        console.log('Current status:', status);
        console.log('Current error:', error);
    }, [data, status, error]);

    if (status === 'loading' && !data) {
        return (
            <Box display="flex" justifyContent="center" alignItems="center" minHeight="80vh">
                <CircularProgress />
            </Box>
        );
    }

    if (status === 'failed') {
        return (
            <Alert severity="error" sx={{ m: 2 }}>
                {error || 'Failed to fetch AWS services status'}
            </Alert>
        );
    }

    return (
        <Box sx={{ 
            background: 'linear-gradient(135deg, #1a237e 0%, #0d47a1 100%)',
            minHeight: '100vh',
            py: 4
        }}>
            <Container maxWidth="xl">
                {/* Enhanced Header */}
                <Box mb={4} sx={{ 
                    display: 'flex', 
                    alignItems: 'center',
                    gap: 2,
                    color: 'white'
                }}>
                    <DashboardIcon sx={{ fontSize: 40 }} />
                    <Typography variant="h4" fontWeight="bold">
                        AWS Infrastructure Monitor
                    </Typography>
                </Box>

                <Grid container spacing={3}>
                    {/* Enhanced Metrics Overview */}
                    <Grid item xs={12}>
                        <DashboardCard>
                            <CardContent>
                                <Grid container spacing={3}>
                                    {/* Resource Count */}
                                    <Grid item xs={12} md={3}>
                                        <MetricBox>
                                            <SpeedIcon color="primary" sx={{ fontSize: 40 }} />
                                            <Box>
                                                <Typography variant="h6" color="primary">Total Resources</Typography>
                                                <Typography variant="h4" fontWeight="bold">
                                                    {data?.ec2?.length + data?.rds?.length || 0}
                                                </Typography>
                                            </Box>
                                        </MetricBox>
                                    </Grid>
                                    {/* ... similar MetricBox components for other metrics ... */}
                                </Grid>
                            </CardContent>
                        </DashboardCard>
                    </Grid>

                    {/* Main Monitoring Sections */}
                    <Grid item xs={12} md={8}>
                        <DashboardCard>
                            <CardContent>
                                {/* Reference to existing EC2 Instances section */}
                                {/* Lines 278-341 */}
                            </CardContent>
                        </DashboardCard>
                    </Grid>

                    {/* Side Metrics */}
                    <Grid item xs={12} md={4}>
                        <Grid container spacing={2}>
                            <Grid item xs={12}>
                                <DashboardCard>
                                    <CardContent>
                                        {/* Reference to Database Performance */}
                                        {/* Lines 376-384 */}
                                    </CardContent>
                                </DashboardCard>
                            </Grid>
                            <Grid item xs={12}>
                                <DashboardCard>
                                    <CardContent>
                                        {/* Reference to Disk Space Metrics */}
                                        {/* Lines 387-394 */}
                                    </CardContent>
                                </DashboardCard>
                            </Grid>
                        </Grid>
                    </Grid>

                    {/* Bottom Section */}
                    <Grid item xs={12}>
                        <Grid container spacing={3}>
                            <Grid item xs={12} md={6}>
                                <DashboardCard>
                                    <CardContent>
                                        {/* Reference to APM Dashboard */}
                                        {/* Lines 494-496 */}
                                    </CardContent>
                                </DashboardCard>
                            </Grid>
                            <Grid item xs={12} md={6}>
                                <DashboardCard>
                                    <CardContent>
                                        {/* Reference to RUM Dashboard */}
                                        {/* Lines 499-501 */}
                                    </CardContent>
                                </DashboardCard>
                            </Grid>
                        </Grid>
                    </Grid>
                </Grid>
            </Container>
        </Box>
    );
};

export default Dashboard;
